import styled from "styled-components";

const DayBox = styled.li`
  list-style: none;
  width: 100%;
  height: 100%;
  border: 1px solid var(--line-gray);
  padding: 1rem;

  &:hover {
    background: var(--whiteblue);
  }
`;

export default function Day(props: { day: number; today: Date }) {
  return props.day !== 0 ? <DayBox>{props.day}</DayBox> : <DayBox></DayBox>;
}
